"use strict";class BrowseDialog extends Dialog{constructor(n,t){super(n);this.gridControl=t}show(n){this.open();this.selectRow(n)}selectRow(n){const t=this.gridControl.selectedRow();if(!t||n!=t.rowIndex){const t=$(this.gridControl.table()).find("tr").eq(n);this.gridControl.selectRow(t);try{t.prev()[0].scrollIntoView()}catch(i){console.log(i)}}}}